  [],\n\t\"revision_timestamp\": \"2016-07-27T23:03:21.513905\",\n\t\"name\": \"herpetological-studies-on-the-carolina-sandhills-national-wildlife-refuge\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This report includes information gathered
  concerning the biology of the amphibians and reptiles of the Carolina Sandhills
  National Wildlife Refuge from summer 1995 through early spring 1997. The data from
  this report and from the survey conducted by Garton and Sill document 70 species
  of amphibians and reptiles occurring on the refuge. Common and scientific names
  follow Collins (1990). This report is divided into four separate sections. The first
  section addresses the herpetofaunal compositionof four separate sites sampled using
  drift fences and cover boards. The second section deals with night collecting along
  Wildlife Drive with emphasis  on the snake community. The third section concerns
  the results of surveying museum collections for specimens of amphibians and reptiles
  from the refuge. The last section is suggestions for further research.\",\n\t\"license_title\":
